    "Calling up current system data at too short intervals can lead to very high CPU consumption, especially under Windows. To switch off individual queries, set the slider to 0.": {"en": "Calling up current system data at too short intervals can lead to very high CPU consumption, especially under Windows. To switch off individual queries, set the slider to 0.", "de": "Das Aufrufen aktueller Systemdaten in zu kurzen Intervallen, kann besonders unter Windows, zu sehr hohen CPU Verbrauch führen. Um einzelnen Abfragen abzuschalten, regler auf 0 stellen.", "ru": "Вызов нынешней системе данные на слишком короткие промежутки времени могут привести к очень высоким потреблением процессора, особенно под Windows. Для выключения отдельных запросов, установите ползунок на 0.", "pt": "A chamada de sistema atual de dados em intervalos curtos pode levar ao alto consumo de CPU, especialmente no Windows. Para desligar, consultas individuais, defina o controle deslizante para 0.", "nl": "Het opvragen van actuele gegevens van het systeem bij een te korte tussenpozen kan leiden tot zeer hoge CPU verbruik, vooral onder Windows. Uitschakelen van individuele vragen, stel de schuifbalk in op 0.", "fr": "L'appel système actuel des données à trop courts intervalles peuvent conduire à de très hautes de la consommation CPU, surtout sous Windows. Pour désactiver les requêtes individuelles, réglez le curseur à 0.", "it": "La chiamata corrente i dati di sistema è troppo brevi intervalli di tempo può portare a molto alto consumo di CPU, soprattutto sotto Windows. Per spegnere le singole query, impostare il dispositivo di scorrimento a 0.", "es": "El llamado sistema de la corriente de datos en intervalos cortos de tiempo puede conducir a muy alto consumo de CPU, especialmente bajo Windows. Para apagar las consultas individuales, ajuste el regulador a 0.", "pl": "Wyzwanie obecnym systemie dane na zbyt krótkich odstępach czasu może spowodować bardzo wysokie zużycie procesora, szczególnie pod Windows. W celu wyłączenia poszczególnych żądań, ustaw suwak na 0.", "zh-cn": "打电话了当前系统的数据在太短的时间间隔可能会导致非常高的中央处理消费，特别是在窗口。 关个人查询，设置滑到0。"},
