    "Ideally, inquiries should be made in English because some developers come from abroad and are not proficient in the local language.": {"en": "Ideally, inquiries should be made in English because some developers come from abroad and are not proficient in the local language.", "de": "Idealerweise sollten Anfragen auf englisch gestellt werden, denn einige Entwickler kommen aus dem Ausland und sind der Landessprache nicht mächtig.", "ru": "В идеале запросы следует направлять на английском языке, поскольку некоторые разработчики приезжают из-за границы и не владеют местным языком.", "pt": "Idealmente, as consultas devem ser feitas em inglês porque alguns desenvolvedores vêm do exterior e não são proficientes no idioma local.", "nl": "Idealiter moeten vragen in het Engels worden gesteld omdat sommige ontwikkelaars uit het buitenland komen en niet bekwaam zijn in de lokale taal.", "fr": "Dans l’idéal, les demandes de renseignements devraient être adressées à l’anglais, car certains développeurs viennent de l’étranger et ne maîtrisent pas la langue locale.", "it": "L'ideale è fare le richieste di informazioni in inglese, in quanto alcuni sviluppatori provengono dall'estero e non hanno una buona conoscenza della lingua locale.", "es": "Lo ideal es que las consultas se realicen en inglés porque algunos desarrolladores provienen del extranjero y no son competentes en el idioma local.", "pl": "W idealnym przypadku zapytania powinny być kierowane w języku angielskim, ponieważ niektórzy programiści pochodzą z zagranicy i nie znają języka lokalnego.", "zh-cn": "理想情况下，查询应该用英语进行，因为有些开发人员来自国外，并且不熟悉当地语言。"},
