    "To better investigate the problem, the following data will be provided to the developer.": {"en": "To better investigate the problem, the following data will be provided to the developer.", "de": "Zur besseren Untersuchung des Problems werden dem Entwickler folgenden Daten zur Verfügung gestellt.", "ru": "Чтобы лучше изучить проблему, следующие данные будут предоставлены разработчику.", "pt": "Para investigar melhor o problema, os dados a seguir serão fornecidos ao desenvolvedor.", "nl": "Om het probleem beter te onderzoeken, worden de volgende gegevens aan de ontwikkelaar verstrekt.", "fr": "Pour mieux étudier le problème, les données suivantes seront fournies au développeur.", "it": "Per analizzare meglio il problema, i seguenti dati saranno forniti allo sviluppatore.", "es": "Para investigar mejor el problema, se proporcionarán los siguientes datos al desarrollador.", "pl": "Aby lepiej zbadać problem, następujące dane zostaną dostarczone do programisty.", "zh-cn": "为了更好地调查此问题，将向开发人员提供以下数据。"},
    "To create messages about adapters or adapter requests, you need a Github account and a token with repo access.": {"en": "To create messages about adapters or adapter requests, you need a Github account and a token with repo access.", "de": "Um Meldungen zu Adaptern oder Adapteranforderungen zu erstellen, benötigen Sie ein Github-Konto und ein Token mit Repo-Zugriff.", "ru": "Для создания сообщений об адаптерах или запросах адаптеров вам необходима учетная запись Github и токен с доступом к репо.", "pt": "Para criar mensagens sobre adaptadores ou pedidos de adaptadores, você precisa de uma conta do Github e um token com acesso ao repositório.", "nl": "Voor het maken van berichten over adapters of adapterverzoeken hebt u een Github-account en een token met repo-toegang nodig.", "fr": "Pour créer des messages sur les adaptateurs ou leurs demandes, vous devez disposer d'un compte Github et d'un jeton avec accès au référentiel.", "it": "Per creare messaggi relativi agli adattatori o per requisiti dell'adattatore, è necessario un account Github e un token con accesso al repository.", "es": "Para crear mensajes sobre adaptadores o solicitudes de adaptadores, necesita una cuenta de Github y un token con acceso de recompra.", "pl": "Aby utworzyć wiadomości o adapterach lub żądaniach adaptera, potrzebujesz konta Github i tokena z dostępem repo.", "zh-cn": "要创建有关适配器或适配器请求的消息，您需要一个Github帐户和一个具有repo访问权限的令牌。"},
    "To read news or forum, you need a free API Key if your ioBroker installation can be reached via a hostname, such as iobroker: 8081 or something similar. For IP access it is not needed.": {"en": "To read news or forum, you need a free API Key if your ioBroker installation can be reached via a hostname, such as iobroker: 8081 or something similar. For IP access it is not needed.", "de": "Um News- oder Forumeinträge zu Lesen, benötigen Sie einen kostenlosen API-Key, wenn Sie ioBroker über einen Hostnamen aufrufen, wie z.B. iobroker:8081 oder so ähnliches. Für den IP-Zugriff ist keine Key erforderlich.", "ru": "Читать новости или форум, вам нужен бесплатный API-ключ, если при установке ioBroker можно добраться через имя хоста, таких как iobroker: 8081 или что-то подобное. Для IP-доступ к нему не нужен.", "pt": "Para ler notícias ou fórum, você precisa de uma API livre-Chave se o seu ioBroker instalação pode ser alcançado através de um nome de host, como iobroker: 8081 ou algo semelhante. Para o IP de acesso não é necessário.", "nl": "Lezen van nieuws of het forum, moet u een gratis API-Sleutel als uw ioBroker installatie kan worden bereikt via een hostname, zoals iobroker: 8081 of iets dergelijks. Voor IP-toegang is niet nodig.", "fr": "Pour lire les news ou sur le forum, vous avez besoin d'une API gratuite si votre ioBroker installation peut être atteint via un nom d'hôte, tels que iobroker: 8081 ou quelque chose de similaire. Pour l'accès IP, il n'est pas nécessaire.", "it": "Per leggere news o un forum avete bisogno di una API-Key gratuita se invocate ioBroker tramite un nome host, per esempio iobroker: 8081 o qualcosa di simile. Per l'accesso tramite IP non è necessario una Key.", "es": "Para leer noticias o en el foro, usted necesita un libre API Key si su ioBroker la instalación puede ser alcanzado a través de un nombre de host, como iobroker: 8081 o algo similar. Para la IP de acceso no es necesario.", "pl": "Czytać wiadomości lub forum, potrzebny jest bezpłatny klucz API, jeśli podczas instalacji ioBroker można dostać się za pomocą nazwy hosta, takich jak iobroker: 8081 lub coś podobnego. Dla IP-dostęp do niego nie jest potrzebny.", "zh-cn": "看新闻或论坛，你需要一个免费的API Key，如果你ioBroker可以通过域名访问到。对于IP的访问它是不是需要的。"},
